function processDataFromClipboard(params) {
        var containsRed;
        var containsYellow;
        var data = params.data;
        for (var i = 0; i < data.length; i++) {
            var row = data[i];
            for (var j = 0; j < row.length; j++) {
                var value = row[j];
                if (value) {
                    if (value.startsWith("Red")) {
                        containsRed = true;
                    } else if (value.startsWith("Yellow")) {
                        containsYellow = true;
                    }
                }
            }
        }
        if (containsRed) {
            return [
                [
                    "Orange",
                    "Orange"
                ],
                [
                    "Grey",
                    "Grey"
                ]
            ];
        }
        if (containsYellow) {
            return null;
        }
        return data;
    }
